import React, { useState } from "react";
import axios from "axios";
import xml2js from "xml2js";

const App = () => {
  const [latitude, setLatitude] = useState("");
  const [longitude, setLongitude] = useState("");
  const [stations, setStations] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState("");

  const fetchStationData = async () => {
    setLoading(true);
    setError("");
    setStations([]);

    // The API URL with latitude and longitude parameters
    const apiUrl = 'http://datos.gob.es/apidata/catalog/dataset/spatial/Autonomia/Pais-Vasco.xml';

    try {
      const response = await axios.get(apiUrl, {
        params: {
          latitud: latitude,
          longitud: longitude
        }
      });

      // Parse XML response
      xml2js.parseString(response.data, { explicitArray: false }, (err, result) => {
        if (err) {
          setError("Error parsing XML");
        } else {
          const estaciones = result.PreciosEESSTerrestres.ListaEESSPrecio.EESSPrecio;
          setStations(estaciones);
        }
      });
    } catch (err) {
      setError("Error fetching data");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div style={styles.container}>
      <h1>Gas Station Prices</h1>
      <div style={styles.form}>
        <input
          type="text"
          placeholder="Enter Latitude"
          value={latitude}
          onChange={(e) => setLatitude(e.target.value)}
          style={styles.input}
        />
        <input
          type="text"
          placeholder="Enter Longitude"
          value={longitude}
          onChange={(e) => setLongitude(e.target.value)}
          style={styles.input}
        />
        <button onClick={fetchStationData} style={styles.button}>
          Get Gas Stations
        </button>
      </div>

      {loading && <p>Loading...</p>}
      {error && <p style={styles.error}>{error}</p>}

      <div style={styles.stations}>
        {stations.length > 0 && (
          <ul>
            {stations.map((station, index) => (
              <li key={index} style={styles.stationItem}>
                <strong>{station["R贸tulo"]}</strong>
                <p>{station["Direcci贸n"]}</p>
                <p>Price: {station["Precio_x0020_Gasoleo_x0020_A"]}</p>
              </li>
            ))}
          </ul>
        )}
      </div>
    </div>
  );
};

// Inline CSS styling
const styles = {
  container: {
    fontFamily: "Arial, sans-serif",
    padding: "20px",
    textAlign: "center",
  },
  form: {
    marginBottom: "20px",
  },
  input: {
    padding: "10px",
    margin: "10px",
    fontSize: "16px",
    width: "200px",
    borderRadius: "4px",
    border: "1px solid #ccc",
  },
  button: {
    padding: "10px 20px",
    fontSize: "16px",
    cursor: "pointer",
    backgroundColor: "#007bff",
    color: "#fff",
    border: "none",
    borderRadius: "4px",
  },
  stations: {
    marginTop: "20px",
    textAlign: "left",
    display: "inline-block",
    padding: "10px",
  },
  stationItem: {
    marginBottom: "10px",
    padding: "10px",
    border: "1px solid #ccc",
    borderRadius: "4px",
    backgroundColor: "#f9f9f9",
  },
  error: {
    color: "red",
    fontWeight: "bold",
  },
};

export default App;
